    font-size: 20px;
    font-weight: bold;
    line-height: 30px;
}
.card .icon-container {
    height: 40px;
    width: 40px;
    border-radius: 50%;
    border: 3px solid rgb(183, 79, 14);
    text-align: center;
    position: relative;
    overflow: hidden;
}

.card .icon-container:before, .card .icon-container:after {
    position: absolute;
    content: '';
    background: rgb(183, 79, 14);
    display: none;
    width: 100%;
    height: 3px;

    left: 0;
    right: 0;
    top: 0;
    bottom: 0;
    margin: auto;
}


.card .description {
    margin-left: 16px;
    font-weight: 500;
    color: rgb(183, 79, 14);
}
.card .value {
    font-size: 40px;
    font-weight: 300;
    letter-spacing: -2px;
}
.card .icon {
    line-height: 36px;
    color: rgb(183, 79, 14);
}
.card video {
    position: absolute;
    top: 50%;
    left: 0;
    width: 100%;
    z-index: -1;
    transform: translateY(-50%);
}

