actionCellButton.customFunction:
var attributeService = widgetContext.attributeService;
var entityType = entityId.entityType;

if (entityType === 'ASSET') { //floor
    openState('floor_details');
} 

else if (entityType === 'DEVICE') { //floor
    var deviceService = widgetContext.deviceService;

deviceService.getDevice(entityId.id, {ignoreLoading: true}).subscribe(
    function (device) {
        var deviceType = device.type;
        var params = {
            entityId: entityId,
            entityName: entityName
        };
        var a = "AEA";
        var b = "BEA";
        var c = "CEA";
        var targetDashboardStateId;
        if(params.entityName.includes(a)){
        switch (deviceType) {
          case "enerji-analizoru":
              targetDashboardStateId = "a_energy_meter";
              break;
          case "enerji-analizoru-komp":
              targetDashboardStateId = "a_energy_meter_komp";
              break;
         
        }
        }
        if(params.entityName.includes(b)){
        switch (deviceType) {
          case "enerji-analizoru":
              targetDashboardStateId = "b_energy_meter";
              break;
          case "enerji-analizoru-komp":
              targetDashboardStateId = "b_energy_meter_komp";
              break;
         
        }
        }
        if(params.entityName.includes(c)){
        switch (deviceType) {
          case "enerji-analizoru":
              targetDashboardStateId = "c_energy_meter";
              break;
          case "enerji-analizoru-komp":
              targetDashboardStateId = "c_energy_meter_komp";
              break;
         
        }
        }
        if (targetDashboardStateId) {
              widgetContext.stateController.openState(targetDashboardStateId, params, false);
        }
    }
);
} 

else if (entityType === 'CUSTOMER') {
    attributeService.getEntityAttributes(entityId, 'SERVER_SCOPE', ['type'], {ignoreLoading: true}).subscribe(
      function(attributes) {
          if (attributes && attributes.length) {
              var type = attributes[0].value;
              if (type === 'building_management_company') {
                  openState('customer_details');
              } else if (type === 'building_management_customer') {
                  openState('sub_customer_details');
              } else if (type === 'building') {
                  openState('building_details');
              }
          }
      }
    );
}

function openState(stateId) {
    if (stateId) {
          var params = {
                entityId: entityId,
                entityName: entityName
          };
          widgetContext.stateController.updateState(stateId, params, false);
    }
}

